import re

def process_dependencies(input_list):
    dependencies = {}
    patches = {}
    for line in input_list:
        if line.startswith('dependency'):
            match = re.search("dependency\\('(.+?)', when='(.+?)', sha256='(.+?)'\\)", line)
            if match:
                (name, version, sha256) = match.groups()
                if name not in dependencies:
                    dependencies[name] = {}
                dependencies[name][version] = sha256
        elif line.startswith('patch'):
            match = re.search("patch\\('(.+?)', sha256='(.+?)', when='(.+?)'\\)", line)
            if match:
                (url, sha256, version) = match.groups()
                if version not in patches:
                    patches[version] = {}
                patches[version][url] = sha256
    return {'': dependencies, 'patches': patches}

